import React, {Component, Fragment} from "react";
import {withRouter} from "react-router";

class index extends Component {
    constructor() {
        super();
        this.state = {}
    }

    render() {
        return (<Fragment><div className={"Login"}>我是/baking中的</div> </Fragment>)
    }

}

export default withRouter(index) ;
